import React from "react";
import { Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import MatchPage from "./pages/MatchPage";

const App = () => {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/match/:matchId" element={<MatchPage />} />
    </Routes>
  );
};

export default App;
